query:
SELECT COUNT(*) as count FROM indicators;
SELECT COUNT(DISTINCT indicatorCode) as covered, MAX(updatedAt) as lastUpdated FROM time_series;
SELECT COUNT(*) as count FROM (
  SELECT indicatorCode, COUNT(*) as records
  FROM time_series
  GROUP BY indicatorCode
  HAVING records < 1000
) as gaps;

